// File: Nav.js
// This component represents the navigation bar, including the logo and login button.
import React from 'react';
import whiteLogo from "../images/tinder_logo_white.png";
import colorLogo from "../images/color-logo-tinder.png";

const Nav = ({ authToken, minimal, setShowModal, showModal, setIsSignUp }) => {
    // Function to handle click event...
    const handleClick = () => {
        setShowModal(true);
        setIsSignUp(false);
      };

    return (
        // JSX for navigation bar...
        <nav>
            <div className="logo-container">
                <img className="logo" src={minimal ? colorLogo : whiteLogo} alt="logo"/>
            </div>
            {!authToken && !minimal && (
                <button className="nav-button" onClick={handleClick} disabled={showModal}>
                    Log in
                </button>
            )}
        </nav>
    );
};

export default Nav;
